import React from 'react';
class Hero extends React.Component{
	constructor(props){
		super(props);
	}
	render(){
		return(
			<div className="section section-2col header">
				<div className="section-2col--light">
				<h1>Hi, I'm Mary Collins, UI developer and Digital Designer.</h1></div>
				<div className="section-2col--dark"></div>
			</div>
			);
	}
}
export default Hero;
